'''Agnar''' is a warrior in the trading section of [[Rellekka]]. He can be asked for his vote during [[The Fremennik Trials]] [[Quests|quest]].

During The Fremennik Trials, when asked for his vote he will say that he will vote for you if you give him 100,000,000,000,000,000,900,470,093 [[coins]]. This is impossible as the maximum coins anyone can hold is 2,147,483,647. He can be found wandering around the market square. At level 45 [[Thieving]] and after [[The Fremennik Trials]], he may be [[Thieving#Pickpocketing|pickpocketed]] for 40 [[coins]] and 65 [[Thieving]] experience.

During [[The Fremennik Exiles]], he barges into the longhall proclaiming to exile the player for ill omens since their integration into Fremennik society, showing his proof with a paper with seven of the twelve council members' signatures, though he reverses his decision when they create [[V's shield]] and apologizes to the player afterwards.
